import React, { Suspense } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { QueryClient, QueryClientProvider } from '@tanstack/react-query';
import { AuthProvider, useAuth } from './hooks/useAuth';
import Layout from './components/Layout';
import EnvironmentSetup from './components/EnvironmentSetup';
import Landing from './pages/Landing';
import Login from './pages/Login';
import Register from './pages/Register';
import EnhancedDashboard from './pages/EnhancedDashboard';
import EnhancedApiKeys from './pages/EnhancedApiKeys';
import EnhancedDocumentation from './pages/EnhancedDocumentation';
import EnhancedMonitor from './pages/EnhancedMonitor';
import LoadingSpinner from './components/LoadingSpinner';

const queryClient = new QueryClient({
  defaultOptions: {
    queries: {
      retry: 1,
      refetchOnWindowFocus: false,
    },
  },
});

// Minimal backend doesn't require authentication
// All routes are public
function AppRoutes() {
  return (
    <Suspense fallback={<LoadingSpinner size="lg" />}>
      <Routes>
        <Route path="/" element={<Landing />} />
        {/* Login/Register not available in minimal backend */}
        <Route path="/login" element={<Navigate to="/api-keys" replace />} />
        <Route path="/register" element={<Navigate to="/api-keys" replace />} />
        <Route path="/dashboard" element={
          <Layout>
            <EnhancedDashboard />
          </Layout>
        } />
        <Route path="/api-keys" element={
          <Layout>
            <EnhancedApiKeys />
          </Layout>
        } />
        <Route path="/documentation" element={
          <Layout>
            <EnhancedDocumentation />
          </Layout>
        } />
        <Route path="/monitor" element={
          <Layout>
            <EnhancedMonitor />
          </Layout>
        } />
      </Routes>
    </Suspense>
  );
}

function App() {
  return (
    <QueryClientProvider client={queryClient}>
      <AuthProvider>
        <Router>
          <div className="App">
            {/* Environment Setup Notice - Only show if API URL is not configured at all */}
            {!process.env.REACT_APP_API_URL ? (
              <div className="min-h-screen bg-gray-50 flex items-center justify-center p-4">
                <div className="max-w-2xl w-full">
                  <EnvironmentSetup />
                </div>
              </div>
            ) : (
              <AppRoutes />
            )}
          </div>
        </Router>
      </AuthProvider>
    </QueryClientProvider>
  );
}

export default App;
